  "KEY_ENTITIES": {
    "NODES": [
      "(:ASN {number})",
      "(:IP {address, botnet, pulse_ids})",
      "(:Country {name})"
    ],
    "RELATIONSHIPS": [
      "(ip:IP)-[:BELONGS_TO]->(asn:ASN)",
      "(ip:IP)-[:ATTACKS {technique, protocol, technology, industry, pulse_id, documented_create_date, documented_modified_date}]->(country:Country)"
    ],
    "NOTES": "The relevant traversal is ASN <- BELONGS_TO - IP - ATTACKS -> Country, counting distinct target countries per ASN. The (ip)-[:FROM]->(country) relationship is not required unless the definition of 'attacked countries' is intended to be constrained by attacker origin, which is not stated."
  },
  "FILTERS": {
    "REQUIRED": [],
    "IMPLICIT": [
      "Count only distinct attacked target countries per ASN (deduplicate countries attacked by multiple IPs within the same ASN and/or multiple ATTACKS events)."
    ],
    "OPTIONAL_CLARIFICATIONS": [
      "If there are ties, return all ASNs tied for the maximum (or clarify whether only one should be returned).",
      "Clarify whether to consider attacks across all time, or only within a time window using documented_create_date / documented_modified_date.",
      "Clarify whether to treat attacks as distinct by pulse_id or include all ATTACKS edges regardless of pulse_id (default: include all and deduplicate only by target country)."
    ]
  },
  "OUTPUT_FORMAT": "Return the ASN number(s) with the highest count of distinct attacked countries, along with that distinct-country count (and optionally the list of attacked country names for validation).",
  "SUGGESTED_APPROACH": "For each ASN, traverse to its IPs, then to the countries those IPs have ATTACKS relationships toward. Aggregate by ASN and compute the number of unique target countries. Sort by this count descending and select the top result; if ties are possible, select all ASNs whose count equals the maximum.",
  "NEEDS_DECOMPOSITION": false,
  "SINGLE_TASK": "Find the ASN(s) whose associated IPs have ATTACKS relationships to the greatest number of distinct target Country nodes, and return the ASN number(s) and that distinct-country count (including all ties for the maximum if applicable)."
}
